function App() {
  const expnenses = [
    {
      title: "Toilet Paper",
      amount: 10,
      date: new date(2021, 12, 12),
    },
    {
      title: "Toilet Paper",
      amount: 10,
      date: new date(2021, 12, 12),
    },
    {
      title: "Toilet Paper",
      amount: 10,
      date: new date(2021, 12, 12),
    },
    {
      title: "Toilet Paper",
      amount: 10,
      date: new date(2021, 12, 12),
    },
  ];
  return (
    <div>
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
